import '../styles/Task.css'

const Task = props => {
    return ( 
        <li className='Task' key={props.childKey}>
            <p>{props.content}</p>
            <p>{props.date}</p>
            <button onClick={(e) => props.handleSubmit(e, props.childKey)}>X</button>
        </li>
    )
}

export default Task
